css:
.document-outline {
  padding: 4px;
  margin-left: 5px;
  display: block;
  overflow-y: auto;
  overflow-x: hidden;
  user-select: none;
  display: flex;
  flex-direction: column;
  color: #abb2bf;
}
.document-outline .list-nested-item {
  margin-top: 2px;
  margin-bottom: 4px;
  padding: 1px 4px;
  display: list-item;
}
.document-outline .list-nested-item span.tree-item-text {
  line-height: normal;
  font-weight: normal;
}
.document-outline .list-nested-item.item-highlight {
  padding: 0 3px;
  border: 1px solid #181a1f;
  border-radius: 3px;
  background-color: rgba(18, 22, 30, 0.1);
  background-blend-mode: multiply;
}
.document-outline .list-nested-item.item-highlight span.tree-item-text {
  font-weight: normal;
}
.document-outline .list-nested-item.current > span.tree-item-text {
  font-weight: bold;
}
.document-outline .list-nested-item .icon {
  width: 16px;
}
.document-outline .list-nested-item .icon.icon-chevron-down:before,
.document-outline .list-nested-item .icon.icon-chevron-right:before {
  font-size: 1.1em;
  margin-right: 0em;
}
.document-outline .list-nested-item .icon.icon-one-dot {
  margin-bottom: -0.7em;
  overflow: hidden;
}
.document-outline .list-nested-item .icon.icon-one-dot:before {
  content: "\25cf";
  font-size: 0.5em;
}
.document-outline .list-nested-item span.tree-item-text:hover {
  text-decoration: underline;
}
.document-outline .list-nested-item .list-tree {
  margin-left: 10px;
}
.document-outline .list-nested-item.level1 {
  z-index: 100;
}
.document-outline .list-nested-item.level2 {
  z-index: 200;
}
.document-outline .list-nested-item.level3 {
  z-index: 300;
}
.document-outline .list-nested-item.level4 {
  z-index: 400;
}
